import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import LandingPage from "./components/pages/LandingPage";

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route exact path="/" component={LandingPage} />
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
